My Pregnancy is a week-by-week pregnancy tracker. Our app will help you over the course of your pregnancy. Stay on top of the changes happening inside your body. Find out how your baby is developing.

Our app is completely free and does not contain advertising.

This app includes:
- week-by-week advice;
- useful information on fetal development and changes in your body;
- week-by-week fetal measurements and imaging;
- a to-do list for each trimester;
- a list of things you will need for hospital check-in, post-natal care and check-out;
- a weight tracker you can use to follow weight gain;
- a kick counter;
- a contraction timer;
- and much more

We have created this app with love, specially for young mothers.

This app is not intended for medical use and is not a substitute for medical consultation.

If you have any questions or requests, please write to neumandev@gmail.com. We are eager to hear your comments on how to improve the app.

Pills Time is a personal pharmacy assistant and one of the most convenient medication reminders. You won't forget to take your medicine – our pill reminder will send you a notification! Now improve your health and quickly defeat any disease is much easier.

Make your medication schedule in accordance with the instructions or recipe given to you by your doctor. Flexible configuration will help you to defer or postpone a regular pill intake. Your courses will be archived, so you can return to them as needed!

Our advantages:
- The schedule for the day, week, month;
- Courses by number of medications;
- Taking medicine daily, every few days, weeks, months;
- Any duration and repetition rates;
- Automatic calculation of the remaining medicine;
- The opportunity to save the current medication;
- History of medication doses directly in the calendar.
- Your own database of medicines, pills and vitamins.

Take care of your health – and Pills Time will help you with this!

Il monitoraggio delle funzioni vitali è un importante componente dell’anestesia e il suo potenziamento nella pratica anestesiologica consente di elevare la sicurezza dell’anestesia migliorando il livello di assistenza del paziente.
L’app Mia è uno strumento veloce e di facile consultazione che contiene i video tutorial delle principali procedure da impiegare nel paziente durante l’anestesia secondo i criteri di sorveglianza clinica e strumentale stabiliti dalle Linee Guida Siaarti.

Realizzata in collaborazione con l’Ospedale Monaldi di Napoli, l’app è stata sviluppata per essere fruibile in sala operatoria:
•	contiene 16 procedure con 16 video tutorial per la misurazione dei parametri ANALGESIA, TEMPERATURA CORPOREA, MIORISOLUZIONE, IPNOSI, EMODINAMICA;
•	è utilizzabile anche offline;
•	contiene i riferimenti alle Linee Guida «Buone Pratiche Cliniche SIAARTI» e i link per la loro consultazione completa;
•	registra la procedura effettuata e rilascia un documento pdf da poter esportare e allegare alla cartella clinica del paziente, in modo anonimo.
